import React from 'react';
import { Link } from 'react-router-dom';

import './Stock.css';
function Stock(props){

    const {isLoggedIn, missing, symbol, price, shares, volume, init_investment, curr_value} = props;

    if (isLoggedIn){
        return (
            <div className="stock__card">
                <ul>
                    <li>You must be logged in to view your portfolio.</li>
                    <li><Link to="/SignIn"> Click here to log in. </Link></li>
                </ul>
            </div>
        );
    }


    if (missing){
        return (
            <div className="stock__card">
                <ul>
                    <li>You have no stocks in your portfolio. Go to the main page to buy stocks.</li>
                </ul>
            </div>
        );
    }

    return (
        <div className="stock__card">
            <ul>
                <li><span className="meta" >Stock Symbol:</span> {symbol}</li>
                <li><span className="meta" >Close:</span> $ {price}</li>
                <li><span className="meta" >Number of Shares:</span> {shares}</li>
                <li><span className="meta" >Total Volume:</span> {volume}</li>
                <li><span className="meta" >Invested:</span> $ {init_investment}</li>
                <li><span className="meta" >Current Value of Stock:</span> $ {curr_value}</li>
                {/* <li>{props.date}</li> */}
        </ul>

        </div>        
    );
}

export default Stock;
